import React, { Component } from "react";

import '../../App.css';
import { Player } from 'video-react';

class Home extends Component {

    constructor(props){
        super(props);       
      
    }
 
  


    render() {
             
        return (
       
        
            <video width="500" height="250" >
                <source src= "https://295-videos.s3.us-east-2.amazonaws.com/AbandonedObject_demo.avi"></source>
            </video>
            

        );
    }
}



export default Home;
